import React, { Component } from "react";

class Profile extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div style={{ background: "linear-gradient(to top, rgb(4, 4, 4), rgba(11, 11, 11, 0.937))" }} className="container-fluid py-5">
                <img alt="" style={{ height: "400px", width: "90%", marginLeft: "70px", border: "10px solid transparent" }} className="coverimg" src="images/coverimg.png" />
                <p>Welcome to your Ala</p>
            </div>
        );
    }
}

export default Profile;
